import LoginIcon from "@heroicons/react/outline/LoginIcon";
import UserIcon from "@heroicons/react/outline/UserCircleIcon";
import SignOut from "@heroicons/react/outline/LogoutIcon";
import { Link } from "react-router-dom";
function Header() {
  const NavItems = [
    {
      title: "Login",
      link: "login",
      icon: <LoginIcon />,
    },
    {
      title: "Logout",
      link: "logout",
      icon: <SignOut />,
    },
    {
      title: "User",
      link: "user",
      icon: <UserIcon />,
    },
  ];

  return (
    <header className="flex justify-between">
      <div>
        <Link to="/">Taskerr</Link>
      </div>
      <ul className="flex">
        {NavItems.map((item, idx) => (
          <Link to={item.link} key={idx} className="flex mr-5">
            {item.title} <div className="text-red-500 h-6 w-6">{item.icon}</div>
          </Link>
        ))}
      </ul>
    </header>
  );
}

export default Header;
